Generally include: 
* settlement account balances - Austraclear and the Reserve Bank Information and Transfer System (RITS) balances with banks and non-bank financial institutions; 
* amounts owing from banks and other financial institutions in relation to the payments system; 
* items in the course of collection from banks and other financial institutions in relation to the payments system; 
* amounts due to the reporting entity in relation to an involvement in an overseas payment system; 
* securities sold not delivered/security settlements - record receivables for unsettled sales of securities. This item arises only if the reporting institution record securities on a settlement date basis as opposed to trade date basis; and * margin deposit accounts with brokers. 
Exclude: * Certificates of deposit. These items should be reported as short-term debt securities in either the Trading Securities or Investment Securities category. This reporting item should be brought to account at the gross value of the outstanding balance, unless a legal right of set-off exists in accordance with AASB 139, AASB 132 and AASB 7. * Deposits that are not on a call basis (e.g. deposits lodged at term that are not on a call basis).

Include Australian and foreign currency notes and coins of the reporting entity. Notes and coins in transit between any branches or offices of the reporting entity should be reported.
Generally include the following in this category:
* Australian notes and coins; 
* foreign currency;
* cash at branches; 
* cash at bankers.

Commercial paper and promissory notes (one-name paper) issued by:
* private trading corporations;
* government non-financial corporations;
* insurance corporations;
* financial auxiliaries and other financial intermediaries; and
* individuals, private unincorporated businesses, and community service organisations.

Report the amount of bills of exchange that have been accepted, or accepted and endorsed, and continue to be held by this entity at market value by counterparty of drawer. Only endorsed bills where this entity is the first endorser of a non-authorised deposit-taking Institution or registered financial corporation accepted bill should be included.
Include only these counterparties:
* private trading corporations;
* government non-financial corporations;
* insurance corporations;
* financial auxiliaries and other financial intermediaries; and
* individuals, private unincorporated businesses, and community service organisations.
Exclude:
* bills of exchange neither accepted nor endorsed.

Report the net market value of investments that include (but are not limited to):
*  interest-rate related investments, loans and advances of the entity;
* placements, loans with, and debt securities issued by Individuals, Unlisted private incorporated entities, and Unlisted private unincorporated entities (including unlisted private trusts);
* other placements, loans and debt securities;
* Short term debt securities (e.g. bills of exchange ,certificates of deposit, commercial paper, promissory notes); and
* Long term debt securities (e.g. Treasury Bonds, securitised instruments).
This should exclude:
* interest-rate related cash; and
* interest rate related derivative contracts.

Commercial paper and promissory notes (one-name paper) issued by:
* private trading corporations;
* government non-financial corporations;
* insurance corporations;
* financial auxiliaries and other financial intermediaries; and
* individuals, private unincorporated businesses, and community service organisations.

Include contributions from members which are receivable in respect of the reporting period (i.e. due but not received). Includes (but is not limited to):
* member post-tax contributions;
* contributions from self-employed members; 
* member contributions required under an industrial agreement or the entity's governing rules; and
* ETP or 'golden handshake' amounts from the employer where they represent pre-tax contributions;
* Capital gains tax (CGT) exempt contributions.
Assets are to be measured at net market value.

The amount of bills of exchange that have been accepted, or accepted and endorsed, and continue to be held by this entity at market value by counterparty of drawer. Only endorsed bills where this entity is the first endorser of a non-authorised deposit-taking Institution or registered financial corporation accepted bill should be included.  Include only these counterparties:
* private trading corporations;
* government non-financial corporations;
* insurance corporations;
* financial auxiliaries and other financial intermediaries; and
* individuals, private unincorporated businesses, and community service organisations.
Exclude:
* bills of exchange neither accepted nor endorsed.
